import React from "react";

export default function Image(props) {
  const { width, height, className, alt = "", src } = props;
  return (
    <div>
      <img
        src={src}
        alt={alt}
        className="bg-cover drop-shadow-2xl rounded-md"
        height={height}
        width={width}
      />
    </div>
  );
}
